import React from "react";

function RecipeCard(props) {
    const { recipe } = props;

    return (
        <div>
            <h2>{recipe.name}</h2>
            <p>Preparation Time: {recipe.prep_time}</p>
            <ul>
            {props.ingredients.map((ingredient) => (
                <li key={ingredient}>{ingredient}</li>
            ))}
            </ul>
            <p>{props.link}</p>
        </div>
      );
}

export default RecipeCard;
